import withLayout from "../components/MyLayout";
import TopCopy from "../components/TopCopy";
import Services from "../components/OurServices";
import About from "../components/About";


const Page = () => (
<div>
  <TopCopy />
  <Services />
  <About />
</div>  
)


export default withLayout(Page);
